INSERT INTO `CMN_LOG_AUTHD` (`LAUTHD_SEQ`, `LAUTH_SEQ`, `PREPARE_SQL`, `FULL_SQL`, `REQ_TOKEN`, `RES_TOKEN`, `PARAM_COLIDS`, `DD_COLIDS`, `PI_IN_COLIDS`, `PI_OUT_COLIDS`, `ROW_CNT`, `ADD_DT`) VALUES
(1, 18, 'select \n	0 AS ROWCHK,VALIDSEQ,PJTSEQ,VALIDID,VALIDNM\n	,VALIDORD,VALIDTYPE,INVALIDMSG,MATSTR\n	,ADDDT,MODDT\nfrom CG_VALID\nwhere PJTSEQ = ?', 'select \n	0 AS ROWCHK,VALIDSEQ,PJTSEQ,VALIDID,VALIDNM\n	,VALIDORD,VALIDTYPE,INVALIDMSG,MATSTR\n	,ADDDT,MODDT\nfrom CG_VALID\nwhere PJTSEQ = \'3\'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '20180313102908'),
