(88, 0, 'select PJTSEQ,PGMSEQ,PGMID,PGMNM,VIEWURL,PGMTYPE,POPWIDTH,POPHEIGHT,SECTYPE,PKGGRP,ADDDT,MODDT \nfrom\n CG_PGMINFO	\nwhere PJTSEQ = ? \n ', 'select PJTSEQ,PGMSEQ,PGMID,PGMNM,VIEWURL,PGMTYPE,POPWIDTH,POPHEIGHT,SECTYPE,PKGGRP,ADDDT,MODDT \nfrom\n CG_PGMINFO	\nwhere PJTSEQ = 3 \n ', 'cf200ff9-42b5-4616-9d12-edc493e510d9 ', '5afa1a0a95f28', 'G3-PJTSEQ', 'PJTSEQ', NULL, NULL, 32, '20180515082146'),
(89, 0, 'select \n a.PJTSEQ, a.DDSEQ, a.COLID, a.COLNM, a.COLSNM\n ,a.DATATYPE, a.DATASIZE, a.OBJTYPE, b.OBJTYPE as OBJTYPE_FORMVIEW, c.OBJTYPE as OBJTYPE_GRID\n ,a.LBLWIDTH, a.LBLHEIGHT, a.LBLALIGN, a.OBJWIDTH, a.OBJHEIGHT, a.OBJALIGN\n ,a.CRYPTCD, a.VALIDSEQ, a.PIYN\n ,a.ADDDT, a.MODDT\nfrom CG_DD a\n	left outer join CG_DDOBJ b on a.DDSEQ = b.DDSEQ and b.GRPTYPE = \'FORMVIEW\'\n	left outer join CG_DDOBJ c on a.DDSEQ = c.DDSEQ and c.GRPTYPE = \'GRID\'\nwhere PJTSEQ = ? \n', 'select \n a.PJTSEQ, a.DDSEQ, a.COLID, a.COLNM, a.COLSNM\n ,a.DATATYPE, a.DATASIZE, a.OBJTYPE, b.OBJTYPE as OBJTYPE_FORMVIEW, c.OBJTYPE as OBJTYPE_GRID\n ,a.LBLWIDTH, a.LBLHEIGHT, a.LBLALIGN, a.OBJWIDTH, a.OBJHEIGHT, a.OBJALIGN\n ,a.CRYPTCD, a.VALIDSEQ, a.PIYN\n ,a.ADDDT, a.MODDT\nfrom CG_DD a\n	left outer join CG_DDOBJ b on a.DDSEQ = b.DDSEQ and b.GRPTYPE = \'FORMVIEW\'\n	left outer join CG_DDOBJ c on a.DDSEQ = c.DDSEQ and c.GRPTYPE = \'GRID\'\nwhere PJTSEQ = 3 \n', '423be730-9a6e-4c35-b2d2-565e75b1ca0f ', '5afa1a0ac3385', 'G3-PJTSEQ', 'PJTSEQ', NULL, NULL, 210, '20180515082147'),
(90, 0, 'SELECT PJTSEQ,FILESEQ,MKFILETYPE,MKFILETYPENM,MKFILEFORMAT,MKFILEEXT,TEMPLATE,FILEORD,USEYN,ADDDT,MODDT\nFROM CG_PJTFILE\nWHERE PJTSEQ = ?\n', 'SELECT PJTSEQ,FILESEQ,MKFILETYPE,MKFILETYPENM,MKFILEFORMAT,MKFILEEXT,TEMPLATE,FILEORD,USEYN,ADDDT,MODDT\nFROM CG_PJTFILE\nWHERE PJTSEQ = \'3\'\n', '1e952a50-bc37-4843-afc0-dfcf07a9ea08 ', '5afa1a0b0e94b', 'G3-PJTSEQ', 'PJTSEQ', NULL, NULL, 5, '20180515082147'),
